Congaree National Park is one of those hidden gems in the NPS. I had no idea there was an enchanted forest in South Carolina. 

@congareenps preserves the largest tract of old growth bottomland hardwood forest left in the country. Some of the tallest trees in eastern US form one of the highest temperate deciduous forest canopies left in the world. 

All of that is just a fancy way to say, Congaree National Park is basically an enchanted forest and we got to explore all of it to kick off filming Season 7 of PARK’d coming to @foxnation!
